import {Route, Router, Swich} from 'react-router-dom'
import AllQuotes from './components/pages/AllQuotes';
import QuoteDetails from './components/pages/QuoteDetails';
function App() {
  return (
    <Switch>
     <Route path='/quotes'>
        <AllQuotes />
     </Route>
     <Route path='/quotes/:quoteid'>
      <QuoteDetails />
     </Route>
     <Route path='/new-quote'> 

     </Route>
    </Switch>
  );
}

export default App;
